import { Link } from "react-router-dom";

const DUMMY_EVENTS = [
    {
        id: 'e1',
        name: 'event 1',
    },
    {
        id: 'e2',
        name: 'event 2',
    },
    {
        id: 'e1',
        name: 'event 3',
    },
];

export default function EventsPage() {
    return <>
        <h1>EventsPage</h1>
        <ul>
            {DUMMY_EVENTS.map((event) => <li key={event.id}><Link></Link> </li>)}
        </ul>
    </>
}
